import styled from 'styled-components';


export const UserPhoto = styled.img`
    height : 7vw;
    border-style: solid;
    border-width: 2px;
    border-color: #d3d3d3;
    border-radius: 50%;
    text-align: right;
    cursor: pointer;

`
